import React, {Component} from 'react'
import './HeaderWall.css'
import Search from './Search.jsx'

class HeaderWall extends Component {

    constructor(props){
        super(props);
        this.state ={
            error:null,
            isLoaded:false,
            items:[]
        };
    }

    componentDidMount(){
        fetch(test.json)
        .then(res =>res.json())
        .then(
            (result) =>{
                this.setState({
                    isLoaded:true,
                    items:result.items
                });
            }
        ),
        (error)=>{
            this.setState({
                isLoaded:true,
                error
            });
        }
    }

    render(){
        const {error, isLoaded, items}=this.state;
        const userName = items[0].name;
        if(error){
            return <div>Error:{error.message}</div>
        }
        return (
            <header>
                <nav className="wallnav">
                    <div className="wallLogo">
                        <a className ="RMITWall">RMITWall</a>
                    </div>

                    <div className="search">
                      <Search/>
                    </div>

                    <div className="Greetings">
                        Welcome, {userName}
                        <img className ="profilePic" src="http://placekitten.com/300/200"></img>
                    </div>
                </nav>
            </header>
        )
    }
}



export default HeaderWall
